function MainPart() {
    return (
        <div className="main_part">
            <nav className="main_part__nav">
                <div className="main_part__nav-img">
                    <img src="/icons/trolleybus_photo.png" alt="main_part_img" width="350" height="200" />
                </div>
                <div className="main_part_h_p">
                    <h1 className="main_part_header"></h1>
                    <h2><button type="button" className="header__category">
                        <a href="#Cart">Cart</a></button></h2>
                </div>
            </nav>
        </div>
    );
}

export default MainPart;
